	public static void main(String args[]){
		@SuppressWarnings("resource")
		Scanner sc = new Scanner(System.in);
		String s = sc.next();
		System.out.println(lengthOfLongestSubstring(s));
	}
	public static int lengthOfLongestSubstring(String s) {
        if(s.length() == 1)
            return 1;
        HashMap<Character,Integer> duplicateTracker = new HashMap<Character,Integer>();
        int maxLength = 0;
        int countNonDuplicate = 0;
        for(int i=0;i<s.length();i++){
            if(duplicateTracker.containsKey(s.charAt(i))){
                i = duplicateTracker.get(s.charAt(i));
                countNonDuplicate = 0;
                duplicateTracker = new HashMap<Character,Integer>();
                continue;
            }
                countNonDuplicate++;
                if(maxLength < countNonDuplicate)
                    maxLength = countNonDuplicate;
                duplicateTracker.put(s.charAt(i),i);
                
        } 
        return maxLength;
    }
